import React, { useState } from 'react';

import Button from '../../component/Button/Button';
import './Task.scss'

const Task = ({ clicked, submittedValue, openModal }) => {

    const [edittedValue, setEdittedValue] = useState("");

    function editTask(event) {
        event.preventDefault();
        setEdittedValue([...edittedValue, edittedValue.submittedValue])
    }

    return (
        <div className='task'>
            <h3>{submittedValue}</h3>
            <button onClick={openModal} className='button'>Edit</button>
        </div>
    );
};

export default Task;
